.drag_tree {
    position: relative;
    cursor: default;
    -webkit-touch-callout: none; /* iOS Safari */
    -webkit-user-select: none; /* Safari */
    -khtml-user-select: none; /* Konqueror HTML */
    -moz-user-select: none; /* Firefox */
    -ms-user-select: none; /* Internet Explorer/Edge */
    user-select: none;
    &__root {
      border-radius: 3px;
    }
    &__list {
      overflow: hidden;
      position: relative;
      padding-bottom: 4px;
    }
    &__node {

    }
}

.tree_item {
    position: relative;
    display: flex;
    flex-direction: row;
    cursor: move;
    font-size: 14px;
    padding-left: 10px;
    padding-right: 10px;
    line-height: 22px;
    border: 1px solid transparent;
}

.tree_item:hover, .tree_item.tree_item_cursor_hover {
  color: red;
}

.tree_item.tree_item_cursor_inside {
  border: 1px solid rgba(255, 255, 255, 0.5);
}

.drag_tree_gap {
    width: 25px;
    min-height: 1px;

}

.drag_tree_toggle {
    display: inline-block;
    text-align: left;
}

.drag_tree_sidebar {
    margin-left: auto;
}

.drag_tree_drag_info {
    position: absolute;
    background-color: rgba(0,0,0,0.5);
    opacity: 0.5;
    margin-left: 20px;
    padding: 5px 10px;
}
.tree_selected {
  > .tree_item {
    background-color: #ddd;
    color: white;
  }
}
.drag_tree_cursor {
  position: absolute;
  border: 1px solid #999;
  height: 3px;
  width: 100%;
}
.tree_title {
  color: #333;
}
.tree_id {
  color: #aaa;
}
